import base64
import java.lang.System
import os
import threading

from burp import IBurpExtender
from burp import IHttpListener
from burp import IHttpRequestResponse
from burp import IResponseInfo

# ####################### #
# command based off of os #
# ####################### #

cmd = None
ost = java.lang.System.getProperty('os.name')
if ost == 'Mac OS X': cmd = 'afplay'
elif ost == 'Linux': cmd = 'mpg123'

# ###### #
# sounds #
# ###### #

perrequestsound = ''
urlparameters = ''

# ######################## #
# functions to play sounds #
# ######################## #

def playPerRequest():
    if cmd:
        if cmd == 'afplay': os.system('%s /tmp/perrequest.mp3' % cmd)
        if cmd == 'mpg123': os.system('%s /tmp/perrequest.mp3' % cmd)

def playURLParameters():
    if cmd:
        if cmd == 'afplay': os.system('%s /tmp/urlparameters.mp3' % cmd)
        if cmd == 'mpg123': os.system('%s /tmp/urlparameters.mp3' % cmd)

# ######################## #
# sound check and creation #
# ######################## #

if ost == 'Mac OS X':
    if not os.path.exists('/tmp/perrequest.mp3'):
        f = open('/tmp/perrequest.mp3', 'w')
        f.write(base64.b64decode(perrequestsound))
        f.close()
    if not os.path.exists('/tmp/urlparameters.mp3'):
        f = open('/tmp/urlparameters.mp3', 'w')
        f.write(base64.b64decode(urlparameters))
        f.close()
elif ost == 'Linux':
    if not os.path.exists('/tmp/perrequest.mp3'):
        f = open('/tmp/perrequest.mp3', 'w')
        f.write(base64.b64decode(perrequestsound))
        f.close()
    if not os.path.exists('/tmp/urlparameters.mp3'):
        f = open('/tmp/urlparameters.mp3', 'w')
        f.write(base64.b64decode(urlparameters))
        f.close()        

# ############## #
# burp extension #
# ############## #

class BurpExtender(IBurpExtender, IHttpListener):

    def registerExtenderCallbacks(self, callbacks):
        self._callbacks = callbacks
        self._helpers = callbacks.getHelpers()
        callbacks.setExtensionName("Polito Inc. :: Audio Cues")
        callbacks.registerHttpListener(self)
        return

    def processHttpMessage(self, toolFlag, messageIsRequest, currentRequest):

        # toolFlag values: http://portswigger.net/burp/extender/api/constant-values.html#burp.IBurpExtenderCallbacks

        # ################## #
        # global information #
        # ################## #

        # get the requestinfo
        requestInfo = self._helpers.analyzeRequest(currentRequest)

        # get the url
        url_obj = requestInfo.getUrl()
        url = str(url_obj)

        if messageIsRequest:
            # ################### #
            # sounds for requests #
            # ################### #
            
            # play our per request sound
            ppt = threading.Thread(target=playPerRequest)
            ppt.daemon = True
            ppt.start()            

        else:
            # #################### #
            # sounds for responses #
            # #################### #
            
            pass

        # ###################################### #
        # sounds for both requests and responses #
        # ###################################### #

        # if the url has parameters in it
        if "?" in url:
            upt = threading.Thread(target=playURLParameters)
            upt.daemon = True
            upt.start()

        return
